import React from "react";
import {LINKS_NAV} from "../config/config_nav";
import {NavLink} from "react-router-dom";

const Navigation = () => {

    const itemNavigation = LINKS_NAV.map(link => {
        return <NavLink key={link.path} to={link.path}>{link.label}</NavLink>
    })
    return <React.Fragment>
        <nav className="nav">
            {itemNavigation}
        </nav>
    </React.Fragment>
}
export default Navigation;
